●軸とグリップを分別して廃棄できる、環境に配慮したドライバーです。●内部にはリサイクル樹脂を使用しています。●グリップ表面のエラストマー樹脂が手にやさしくフィットし、トルクの伝達も向上します。<BR>●あらゆるネジ締め作業に。<BR>●刃先:[[(+)]]No.1●軸長(mm):25●全長(mm):50●軸径(mm):6●質量(g):32.5●グリップ径(mm):45<BR>●刃先:マグネット入り●クロームバナジューム鋼、全身焼入。●刃先は高精度のブラックポイント加工。●軸部は六価クロムフリー。環境負荷物質を含まない表面メッキ仕上げ。●マグネット入り<BR>●軸：クロームバナジューム鋼/ブラックポイント●グリップ：樹脂<BR>●貫通ドライバーではありません。●ハンマーでたたくと軸が抜けなくなったり、変形・破損の原因となります。<tr><td colspan="2">
